import "./Main.css";
import React from "react";
import Promo from "../Promo/Promo";
import Portfolio from "../Portfolio/Portfolio";

function Main() {
  return (
    <main className="main">
      <Promo />
      <Portfolio />
    </main>
  );
}

export default Main;
